import React, { Component } from "react";
import styled from "styled-components";
import { Col, Row, Container } from "reactstrap";

const Myh1 = styled.h1`
  color: red;
`;

class App extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col>
            <h1>Header</h1>
          </Col>
        </Row>
        <Row>
          <Col>
            <h2>Jumbotron</h2>
          </Col>
        </Row>
        <Row>
          <Col>
            <h3>Card?</h3>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default App;
